  const { gitLangFreq, gitLangs, isLoading } = useGitProjectCalculator();

  if (isLoading) {
    return <p>Loading</p>;
  }

  console.log(gitLangFreq);
  console.log(gitLangFreq && Object.keys(gitLangFreq));

  return (
    <React.Fragment>
      {/* {gitLangs.map((item, index) => {
        return <GitProject language={item} ammount={gitLangFreq[index]} />;
      })} */}
    </React.Fragment>
  );
};

export default LangGenerator;
